import React, { useState } from 'react';
import './styles.css';

const Footer = () => {
  const [name, setName] = useState('');

  return (
    <div class="footer">
      Contact Me
      <form>
        Name:{' '}
        <input
          type="text"
          value={name}
          onChange={(e) => {
            setName(e.target.value);
          }}
        />
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
};

export default Footer;
